Записаться на тест-драйв, а так же получить подробную информацию можно у специалистов автоцентра по указанному номеру телефона

Время работы с 10:00 до 20:00 без выходных

Вашему вниманию представляем автомобиль с пробегом Volkswagen Golf

ДОСТАВКА АВТОМОБИЛЯ В ЛЮБОЙ РЕГИОН РФ

Автомобиль в хорошем состоянии. ПТС оригинал. Два собственника. Оригинальный пробег. Аккуратная и бережная эксплуатация.
Мультимедиа: AUX
Салон: ткань, 5 мест, подогрев сидений, Складывающееся заднее сидение
Комфорт: электростеклоподъемники передние, кондиционер, парктроник, Электропривод зеркал
Автомобиль полностью готов к эксплуатации.

